	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  390765,"1",27359,1171,1919,
	  "0.25 USD",52.000,NULL,"The strips in this volume are not dated and are probably not sequential.A Cupples & Leon ad in the September 15 1920 issue of The Bookseller Newsdealer and Stationer lists the book's retail price as 25 cents.The on-sale date was most likely March 4 1919. The Copyright Office filings for the first and second books in the series appear to have been transposed somehow. The March 4 date is reported for the second book but the first book's publication date is reported as August 7 1919. The second book also includes strips that were published in newspapers after March 4 which makes it all but impossible that it was published on that date.",
	  NULL,NULL,NULL,NULL,1919,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  390766,"2",27359,1171,1919,
	  "0.25 USD",52.000,NULL,"A Cupples & Leon ad in the September 15 1920 issue of The Bookseller Newsdealer and Stationer lists the book's retail price as 25 cents.The on-sale date was most likely August 7 1919. The Copyright Office filings for the first and second books in the series appear to have been transposed somehow. The date reported for this second book is March 4 1919 but the first book's publication date is reported as August 7. This second book also includes strips that were published in newspapers after March 4 which makes it all but impossible that it was published on that date.",
	  NULL,NULL,NULL,NULL,1919,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
