	  395415,"674",16530,2,2008,
	  "2.99 USD; 3.65 CAD",36.000,"monthly","This issue was originally solicited to contain the comic book debut of the \"Smallville\" TV show character Chloe Sullivan but DC decided to pull that (as a rights problem developed at the last minute) and have Kurt Busiek write a new story.  This contents change was announced via a press release on 2008-02-26.The solicitation for the original (mostly-unpublished) story read: \"It's a time of new beginnings for Superman as art sensation Renato Guedes joins the team! Plus the superhuman mastermind Paragon is loose in Metropolis Clark and Lois are hunting for a new place to live after the events of \"Insect Queen\" and worse they've got relatives coming to visit  namely a certain blonde cousin of Lois's from Smallville. It all sets the stage for a major new addition to the cast in next months anniversary issue! Can you say \"Chloe Sullivan\"? We thought you could...\"",
